import React from "react";
import Tree from "react-d3-tree";
import styles from "./TreeComponent.module.css";

const myTreeData = [
  {
    name: "Top Level",
    attributes: {
      keyA: "val A",
      keyB: "val B",
      keyC: "val C"
    },
    children: [
      {
        name: "Level 2: A",
        attributes: {
          keyA: "val A",
          keyB: "val B",
          keyC: "val C"
        }
      },
      {
        name: "Level 2: B"
      }
    ]
  }
];

const TreeComponent = () => {
  return (
    <div className={styles.tree}>
      <Tree data={myTreeData} orientation="vertical" />;
    </div>
  );
};

export default TreeComponent;
